import React from 'react';
import { Routes, Route } from 'react-router-dom';
import Chart from './Components/chart';

function App() {
  return (
    <div>

      <Routes>
        <Route path="/" element={<Chart />} />

      </Routes>
    </div>
  );
}

export default App;
